import React from "react"
import { useEffect, useState } from "react"
import "./Home.css"
import {LogsWindow} from "../LogsWindow/LogsWindow"
import { eel } from "../../eel";

export const Home = () => {

    const [logList, setLogList] = useState<string[]>([])
    const [logPath, setLogPath] = useState("")

    const handleLogList = (arg:any)=>{
        console.log(arg)
        setLogList(arg)
    }

    useEffect(()=>{
            console.log(eel)
    },[])

    useEffect(()=>{
        console.log("State has changed")
    },[logList])

    return(
        <>
            <input type="text" placeholder="Type filepath" onChange={(event)=>{setLogPath(event.target.value)}}/>
            <button onClick={()=>eel.getLogJournalFromFile(logPath)(handleLogList)}>Open file</button>
            <div>{eel.printHello("Hello World")(function(value:string){
                console.log(value)
                console.log("Cokolwiek")
            })}
            </div>
            <div className="main-container">
                <LogsWindow logList={logList} handleLogList={handleLogList}/>
                <div>Second Hello</div>
            </div>
        </>
    )


}
